  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Mackay Island
  National Wildlife Refuge summarizes refuge activities for fiscal year 1975. The
  report begins with a summary of weather and habitat conditions during the period.
  A wildlife section covers migratory birds, big game animals, furbearers, fish, and
  reptiles. A refuge development and maintenance section outlines physical development,
  plantings, vegetation control, and fires. A resource management section summarizes
  fur harvest and commercial fishing in the refuge. The field investigation and applied
  research section discusses bird banding, scientific collecting, and predator control.
  The public relations section outlines recreational use, refuge visitation, hunting,
  law enforcement, and safety. Items of interest are provided at the end of the report.\",\n\t\"license_title\":
